import { View, Text } from "react-native";
import { Link } from "react-router-native";
import categoriesStyles from "../styles/categories";

const categories = [
    "Hombros",
    "Triceps",
    "Biceps",
    "Pectoral",
    "Espalda",
    "Piernas",
    "Abdominales"
];

const CategoriesExercise = () => {
    return (<>
        {categories.map((category, index) =>
            <Link to={`/categories/${category}`} key={`category-${index}`}>
                <Text style={categoriesStyles.category}>{category}</Text>
            </Link>
        )}
    </>);
}

export default CategoriesExercise;
